import React, { useState } from 'react';
import './Navbar.css';

const Navbar = ({ setLoginUser }) => {
  const [showMenu, setShowMenu] = useState(false);

  const handleToggleMenu = () => {
    setShowMenu(!showMenu);
  };

  const handleLogout = () => {
    setLoginUser('');
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <span className="navbar-title">Navbar</span>
      </div>
      <div className="navbar-items-container">
        <ul className={`navbar-items ${showMenu ? 'show' : ''}`}>
          <li className="navbar-item">Quote</li>
          <li className="navbar-item">Weather</li>
          <li className="navbar-item">Todo</li>
          <li className="navbar-item">News</li>
        </ul>
        <div className="button" onClick={handleLogout}>
          Logout
        </div>
      </div>
      <button className="hamburger" onClick={handleToggleMenu}>
        <span className={`hamburger-icon ${showMenu ? 'open' : ''}`} />
      </button>
    </nav>
  );
};

export default Navbar;
